import styled from 'styled-components';

export const Container = styled.div`
width: 290px;
height: 90 px;
background: #20295F;
padding: 10px;

display: flex;
flex-direction: column;
justify-content: space-around;
border-radius: 5px;

img {
    width: 25px;
    height: 25px;
}

span {
    color:#FFF;
    font-weight: bold;
    align-self: flex-end;
    font-size: 18px;
}

`
